neo4j.cypher:
MATCH (c:Classroom {roomNumber: "1608"})-[:BELONGS_TO]->(b:Building) 
WHERE b.buildingNumber = "1" AND b.name = "格物楼"
RETURN b;

MATCH (c:Course {courseId: '2508'})<-[:OFFERED_AS]-(cs:CourseSession)-[:HAS_MEETING]->(m:Meeting)-[:AT_CLASSROOM]->(cl:Classroom)-[:BELONGS_TO]->(b:Building)
WHERE c.department = '信息学院'
RETURN DISTINCT b.name;

MATCH (courseSession:CourseSession)-[r:TAUGHT_BY]->(person:Person)
WHERE courseSession.courseId = "应用多元统计分析实验"
RETURN person.name AS 教师姓名;

MATCH (c:Classroom {roomNumber: "2403"})<-[:BELONGS_TO]-(b:Building) 
WHERE b.buildingNumber = "2" AND b.name = "格物楼"
RETURN b.name AS BuildingName, b.buildingNumber AS BuildingNumber;

MATCH (c:Classroom)-[:BELONGS_TO]->(b:Building {name: "力行楼"}) 
WHERE c.roomNumber = "4609" 
RETURN c.capacity;

MATCH (p:Person {name: '赵莉莉'})-[:TAUGHT_BY]->(cs:CourseSession)-[:OFFERED_AS]->(c:Course {courseId: '高等数学A（2）'})
OPTIONAL MATCH (cs)-[:HAS_MEETING]->(m:Meeting)-[:AT_CLASSROOM]->(cl:Classroom)
RETURN m.start_time, m.end_time, cl.name, cl.room_number;
